import { Component } from "react";

let styles = {
	h4: {
		color: 'red'
	}
}

class Stock extends Component {
	
	render(){
		const { bike } = this.props
		return(
			<div style={styles.h4}>
				<h4>{bike.stock-1}</h4>
			</div>
		)
	}
}



export default Stock
